import { useNavigate } from 'react-router-dom';
import './Home.css';

export function Home() {
    const navigate = useNavigate();

    const logIn = async () => {
        navigate('/');
    };

    const category = async () => {
        navigate('/category');
    };

    return (
        <div className="home-container">
            <div className="header">
                <div className="logo-section">
                    <h1 className="logo">
                        Flex<span className="white-text">Fuels</span>
                        <p className="tagline">...a one stop solution for optimum nutrition</p>
                    </h1>
                    <div className="search-bar">
                        <input type="text" placeholder="Search" />
                        <button className="search-button">
                            <i className="fa fa-search"></i>
                        </button>
                    </div>
                    <div className="header-right">
                        <i className="fa fa-shopping-bag"></i>
                        <button onClick={logIn} className="login-signup-button">Login/Sign Up</button>
                    </div>
                </div>
            </div>

            <div className="poster">Poster</div>

            <div className="categories-section">
                <button className="category-button">Best Seller</button>
                <button onClick={category} className="category-button">Categories</button>
            </div>

            <section className="shop-by-level">
                <h2>Shop by Level</h2>
                <div className="level-buttons">
                    <img src="/images/beginner.jpg" alt="Beginner Level" className="level-image" />
                    <img src="intermediate.jpg" alt="Intermediate Level" className="level-image" />
                    <img src="advanced.jpg" alt="Advanced Level" className="level-image" />
                </div>
            </section>

            <section className="shop-by-brand">
                <h2>Shop by Brand</h2>
                <div className="brand-buttons">
                    <img src="brand1.jpg" alt="Brand 1" className="brand-image" />
                    <img src="brand2.jpg" alt="Brand 2" className="brand-image" />
                    <img src="brand3.jpg" alt="Brand 3" className="brand-image" />
                </div>
            </section>
        </div>
    );
}

export default Home;
